import React,{useState} from 'react'
import Inner from './Inner';
import './Practice.css';

function Practice() {

const[value,setValue]=useState("");

const HandleMouseEnter=()=>{
setValue(MouseEnter)
}
const HandleMouseOut=()=>{
    setValue(MouseOut)
}

return (
    <div className='Wrapper'>
<div className='Wrapper_inner1'>
    <h5 onMouseEnter={HandleMouseEnter} onMouseOut={HandleMouseOut}>Profile</h5>
    <Inner state={value} />
</div>
<div className='Wrapper_inner2'>
    <h5 onMouseEnter={HandleMouseEnter} onMouseOut={HandleMouseOut}>About Us</h5>
    <Inner state={value} />
</div>
<div className='Wrapper_inner3'>
    <h5 onMouseEnter={HandleMouseEnter} onMouseOut={HandleMouseOut}>Contact</h5>
    <Inner state={value} />
</div>
<div className='Wrapper_inner4'></div>
<h5 onMouseEnter={HandleMouseEnter} onMouseOut={HandleMouseOut}>Links</h5>
<Inner state={value} />
 </div>
  )
}

export default Practice
